import axios from 'axios';


const Get = () => {
  const [city, setCity] = useState('');

  const getCity =  () => {
    axios.get(`/predict/${city}`)
    .then((res) => {
      setCity(res.data);
      console.log(res.data)
    });
   ;
  };

  useEffect(() => {
    getCity();
  },);

  return (
    <>
      {city}
    </>
  );
};

export default Get;
